function Speakers() {
    return (
        <div>
            <img src='images/header.png'/>
            <img src='images/menu.gif'/>
            <img src='images/searchbar.git'/>
            <img src='images/speakers.png'/>
            <img src='images/footer.png'/>
        </div>
    );
}
export default Speakers;
